import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import '../SignStyle.css';


export class SignIn extends Component {

    state = {
        user_name,
        user_password,
        user_email
    };



    render() {



        return (
            <div class="wrapper fadeInDown">
                <div id="formContent">
                    <h2 class="active"> Sign In </h2>

                    <div class="fadeIn first">
                        <i class="fa-solid fa-user fa-6x mb-2 mt-2"></i>
                    </div>

                    <form name="signiF" action="/Dashboard" onsubmit="return validateForm()" method="GET">
                        <input  type="text" id="login" class="fadeIn second" name="user-name" value={this.state.user_name} placeholder="login"/>
                        <input type="password" id="password" class="fadeIn third" name="user-pass" value={this.state.user_password} placeholder="password"/>
                        <input type="submit" class="fadeIn fourth" value="Log In" />
                    </form>

                    <div id="formFooter">
                        <Link class="underlineHover" to="/forget-password">Forgot Password?</Link>
                        <br />
                        <Link class="underlineHover" to="/rigister">Create an account ?</Link>
                    </div>

                </div>
            </div>

        )

    }
}


export default SignIn
